import { useNavigate } from "react-router-dom";

function TelaLogin2() {


    const navigate = useNavigate();

    return (
        <>
            <h1>TELA LOGIN-2</h1>
            <h1>TrackIt</h1>
            <button onClick={() => alert("botão apertado")}>Entrar</button>
            <p onClick={() => navigate("/cadastro")}>Não tem uma conta? Cadastre-se</p>
        </>
    )
}

export default TelaLogin2;
